import Question from "./Question";
import { useNavigate, useParams } from "react-router-dom";
import useFetch from "./useFetch";
import { useState } from "react";

const Exam = () => {
  const { id } = useParams();
  questionNumber = useState(1);
  const {
    data: question,
    isPending,
    error,
  } = useFetch(
    "http://localhost:8000/questions?examID=" + id + "&id=" + questionNumber
  );

  return (
    <div className="exam-frame">
      <Question />
    </div>
  );
};

export default Exam;
